private int scaledIterationCount(int shapes) {
  if (shapes < 500) {
    return atLeast(50);
  } else if (shapes < 5000) {
    return atLeast(25);
  } else if (shapes < 25000) {
    return atLeast(5);
  } else {
    return atLeast(2);
  }
}

